The Court sentences the defendant to the Wisconsin State Prison System for a total of seven (7) years.  That is four (4) years initial confinement followed by three (3) years extended supervision.  Execution of sentence is stayed and the defendant is placed on probation for a period of four (4) years.   The defendant is placed on probation to DOC for four (4) years, consecutive to the sentence being served in 09CF274, to commence upon defendant's discharge date after extended supervision ends. 
Conditions of probation: 
1)   Maintain absolute sobriety;
2)   Maintain fulltime employment, schooling or combination;
3)   Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
4)   Pay supervision fees in an amount to be determined by DOC; 
5)   Pay court costs of $518.00.  $1,500.00 cash bail applied.  Remaining $982.00 cash bail to be returned to Brittany Wilde;
6)   Six (6) months in the county jail, under the Huber law, stayed, to be imposed at the agent's discretion and upon order of the Court. 
DNA sample is not ordered, already on file.
Defendant is eligible for the Challenge Incarceration Program and the Substance Abuse Program.  (See email correspondence dated 02-19-2018).
